import React from "react";
import { Carousel } from "react-bootstrap";

import "./styles/Projects.css";

function Projects() {
  return(
    <div className={"main-content"}>
      <h3>{`<Projects/>`}</h3>
        <Carousel
            className={"projects_carousel"}
            indicators={false}
        >
            <Carousel.Item>

                <Carousel.Caption>
                    <h3>Personal Website</h3>
                    <p>Frontend webapp designed in React and Bootstrap</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>

                <Carousel.Caption>
                    <h3>Scotch Music Player</h3>
                    <p>Desktop music player built using React and Electron</p>
                </Carousel.Caption>
            </Carousel.Item>
        </Carousel>
    </div>
  )
}

export default Projects;
